import axios from "axios";
import { useEffect, useState } from "react";

function Fail() {
  let [errMessage, setErrMessage] = useState("");

  const checkFlash = () => {
    axios.get("/api/fail").then((res) => {
      console.log(res.error);
      setErrMessage(res.error);
    });
  };

  useEffect(() => {
    checkFlash();
  });

  return (
    <div>
      <p>{errMessage}</p>
    </div>
  );
}
export default Fail;
